import React, { Fragment } from 'react';

export const PhoneUnderCard = () => {
  return (
    <Fragment>
      <div className='col-6'>
        <div className='imgbox'>
          <img src='image/phone-under/img1.jpg' className='img-fluid' />
        </div>
      </div>
    </Fragment>
  );
};
